import React, { Component } from "react";
import {ToggleButtonGroup , ToggleButton} from 'react-bootstrap';
import ButtonToolbar from "reactstrap/es/ButtonToolbar";
class Home extends Component
{
    render()
    {
        return(
            <div>
                <div className="jumbotron">
                    <div className="text-left">
                        <h1>Welcome to waas portal</h1>
                    </div>
                    <div className="text-right">

                        <ButtonToolbar className="secondary">
                            Your Current wallets are:<br/>
                        <ToggleButtonGroup offstyle="danger" type="radio" name="options" defaultValue={1}>
                            <ToggleButton value={1}>Wallet 1 </ToggleButton>
                            <ToggleButton value={2}>Wallet 2</ToggleButton>
                            <ToggleButton value={3}>Wallet 3</ToggleButton>
                        </ToggleButtonGroup>
                        </ButtonToolbar>
                        <button>Add a new Wallet</button>
                    </div>
                </div>

                <div className="container">


                </div>
            </div>
        )
    }
}
export default Home;
